import React from "react";
import { useState, useEffect } from 'react';

import Video from "../components/video";

export default function video() {
    const [photos, setPhotos] = useState([]);
  useEffect(() => {
    fetch('https://jsonplaceholder.typicode.com/photos')
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        console.log(data);
        setPhotos(data);
      });
  }, []);
  return (
    <div>

      {photos.map((photo) => (
        <img key={photo.id} src={photo.url} alt={photo.title} width={100} />
      ))}
    </div>
  );
    return (
        <div className="home-page">
            <Video 
                videoImage={"https://i.ytimg.com/vi/1q6ws2CcLHU/hq720.jpg?sqp=-oaymwEcCNAFEJQDSFXyq4qpAw4IARUAAIhCGAFwAcABBg==&rs=AOn4CLCG-v-SOfiAJIDyJlI3n3mIMogvQw"} 
                videoTitle={"9 advanced tips of layout & composition in Web Design"}
                videoTime={"16:11"}
                videoViews={"133k views"}
                videoDate={"4 months ago"}
                channelImage={"https://yt3.ggpht.com/ytc/AIf8zZS-iFd4VHDiWk9jm5ZVDPOOgNzh2Dl2_hWlykqrvg=s68-c-k-c0x00ffffff-no-rj"}
                channelName={"BONT"}
                />
            <Video 
                videoImage={"https://i.ytimg.com/vi/KuhfT6-I3QU/hq720.jpg?sqp=-…AFwAcABBg==&rs=AOn4CLDB9ad3fXWM8Tvz--c1yPbDO3eC3w"} 
                videoTitle={"Rethinking React"}
                videoTime={"12:33"}
                videoViews={"8.3k views"}
                videoDate={"2 hours ago"}
                channelImage={"https://yt3.ggpht.com/4NapxEtLcHQ6wN2zA_DMmkOk47RFb_gy6sjSmUZGg_ARHjlIUjFsrNFddrcKMkTYpBNxCp3J=s68-c-k-c0x00ffffff-no-rj"}
                channelName={"Theo - t3.gg"}
                />
            <Video 
                videoImage={"https://i.ytimg.com/vi/gUmagAluXpk/hq720.jpg?sqp=-oaymwEcCNAFEJQDSFXyq4qpAw4IARUAAIhCGAFwAcABBg==&rs=AOn4CLAtMkx1-7FNgk00f2UPJcSdcuIVxQ"} 
                videoTitle={"How I’d learn ML in 2024 (if I could start over)"}
                videoTime={"7:05"}
                videoViews={"379k views"}
                videoDate={"1 month ago"}
                channelImage={"https://yt3.ggpht.com/ytc/AIf8zZSSDh0W9pKzsI4DvsnRkLZnhcZ7dV6UmYdE7f3zWw=s68-c-k-c0x00ffffff-no-rj"}
                channelName={"Boris Meinardus"}
                />
            <Video 
                videoImage={"https://i.ytimg.com/vi/1q6ws2CcLHU/hq720.jpg?sqp=-oaymwEcCNAFEJQDSFXyq4qpAw4IARUAAIhCGAFwAcABBg==&rs=AOn4CLCG-v-SOfiAJIDyJlI3n3mIMogvQw"} 
                videoTitle={"9 advanced tips of layout & composition in Web Design"}
                videoTime={"16:11"}
                videoViews={"133k views"}
                videoDate={"4 months ago"}
                channelImage={"https://yt3.ggpht.com/ytc/AIf8zZS-iFd4VHDiWk9jm5ZVDPOOgNzh2Dl2_hWlykqrvg=s68-c-k-c0x00ffffff-no-rj"}
                channelName={"BONT"}
                />

        </div>
    )
}
